//ROUTERS ---->link specific components one page to another page ("link tag")
//applicable both claass and functions

import "./route.css"
function App4(){
    return(
        <div>
            <ul>
                <li>HOME</li>
                <li>ABOUT</li>
                <li>NOTICE</li>
                <li>CONTACT US</li>
                <li>HELP LINE</li>
            </ul>
        </div>
    )
}
export default App4;
